import React, { Component } from 'react'
import "./css/styles.css";
import "./css/w3schools.css";

export default class AboutMe extends Component {
  render() {
    return (
      <div>
        <img src="blue_back.JPG" class="introbackdrop" alt="background blue" width="1430px" height="900px"/>
        <div class="centered">
          <h2 class="georgia">SUp</h2>
        </div>
      </div>
    )
  }
}
